  state = {
    users: [
      { name: "Bibs", profit: 400, avg: 24.2, numOfGames: 4 },
      { name: "Vasil", profit: -250, avg: -33, numOfGames: 6 },
      { name: "Rami", profit: 455, avg: 25, numOfGames: 7 },
      { name: "Dudi", profit: -250, avg: -11, numOfGames: 8 },
    ],
  };
  render() {
    // const { users } = this.state;
    return (
      <div className="container">
        <div className="row">
          <h1 className="text-center text-primary">Poker @ Vasili</h1>
          <table className="table table-border">
            <thead>
              <th>Name</th>
              <th></th>
              <th></th>
              <th></th>
            </thead>
          </table>
        </div>
      </div>
    );
  }
}
export default Main;
